if mibBuilder.loadTexts: dtiProtocolClientFsmStatsTable.setDescription('Statistics associated to the DTI client state machine. This table contains counters of the most significant DTI finite State machine transitions and states as reported in the DTI Client Frame. Below is a description of the State Transition and counters supported (not all State Transitions need object definitions): T1: Warmup to Free-run Normally once after the clock warms up. Rather than defining a counter for this state transition, the managed system updates the object ifDiscontinuity with the time when the clock performs a transition to Free-run State T2: Free-run to Fast Not defined counter. T2 = T3 + 1 T3: Fast to Free-run (dtiProtocolClientFsmStatsT3Count) T4: Fast to Normal (dtiProtocolClientFsmStatsT4Count) Counts the times the clock enters to the normal mode of operation. T5: Normal to Bridging Not defined counter. T5 = T6 + T7 T6: Bridging to Normal (dtiProtocolClientFsmStatsT6Count) T7: Bridging to Holdover (dtiProtocolClientFsmStatsT7Count) T8: Holdover to Fast No counter defined. If DTI Client State is Holdover, T8 = T7 - 1 other DTI Client State, T8 = T7 This table also includes the active time the DTI client is in Normal state(dtiProtocolClientFsmStatsNormalActiveTime) and Holdover state (dtiProtocolClientFsmStatsHoldoverActiveTime).')
